import React from 'react';
import './AboutMe.css';
import { makeStyles } from '@material-ui/core/styles';

import GridList from '@material-ui/core/GridList';
import GridListTile from '@material-ui/core/GridListTile';


const useStyles = makeStyles((theme) => ({
  root: {
    display: 'flex',
    flexWrap: 'wrap',
    justifyContent: 'space-around',
    overflow: 'hidden',
    paddingBottom: 100
  },
  gridList: {
    width: 750,
    height: 1000,
    paddingTop: 100,
  },
  text:{
    display: 'flex',
    flexWrap: 'wrap',
    justifyContent: 'space-around',
    overflow: 'hidden',
    minHeight: 1000,
  },
  title:{
    display: 'flex',
    flexWrap: 'wrap',
    justifyContent: 'space-around',
    overflow: 'hidden',
    position: "absolute",
    zIndex: 1
  },
  img:{
    height: 1000,
    width: 1
  }
}));
export default function AboutMe(props) {
  const classes = useStyles(); 
    return(
      <div className={classes.root}>

        <GridList cellHeight={750}className={classes.gridList} cols={1} alignItems="flex-end">
            <GridListTile key={"text-about-me"} cols={1 || 1}>
                <div className={classes.text}>
                  Hello and welcome to my portfolio! A congregation of my experiences and thoughts. I'm a graduate from Washington University in St. Louis with a BS in Computer Science.
                I bring a unique role to every team I am apart of: having technical experience from a Computer Science degree, but also having the human centered design and creative problem solving experience gained from my work. HCD and creative problem solving have been a key portion of my education and experiences.
                My goal is to cater to user experience and accessibility above all else.
                </div>
            </GridListTile>
        </GridList>


      </div>
    )
}
